import logo from './logo.svg';
import './App.css';

//const url = "https://play-lh.googleusercontent.com/iTSTdNsGGWvJ6oEKuQpvHEPf4uwC_f9DhebfpL5T1Hi0iPuxtoce2PmY8jiC2j_oXZOb"

function App(props) {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          {props.saludo}
        </a>
      </header>
    </div>
  );
}

export default App;
